import {BrowserRouter,Route,Routes,Link} from "react-router-dom";  
import Backend from "./backend";
import Admin from "./admin";
import Login from "./login";
import Home_page from "./home";
import personal from "../route/personal";

const Home=()=> {
  return (
      <BrowserRouter>
        <Routes>
          {
            personal.map(({path, component, ...routes})=>{
              console.log("path ==>",path)
              console.log("component ==>",component)
              console.log("...routes")
              return(
                <Route key={path} exact={true} path={path} element={component} {...routes}/>
              )
            }

            )
          }

          <Route exact={true} path="/backend" element={<Backend/>}/>
          <Route exact={true} path="/admin" element={<Admin/>}/>
          <Route exact={true} path="/" element={<Home_page/>}/>
        </Routes>
      </BrowserRouter>
  )
}

export default Home;
